const stringSimilarity = require("string-similarity");
let listPhones = $input.first().json;
let gsmSource = $input.last().json;
class PhoneCompare {
    normalizeBrand(t) {
        t = t.toLowerCase();
        if (t.startsWith("iphone") || t.startsWith("apple")) return "apple";
        if (t.startsWith("samsung")) return "samsung";
        if (["xiaomi", "redmi", "poco"].some(p => t.startsWith(p))) return "xiaomi";
        if (t.startsWith("meizu")) return "meizu";
        if (t.startsWith("oppo")) return "oppo";
        if (t.startsWith("oneplus")) return "oneplus";
        if (t.startsWith("realme")) return "realme";
        if (t.startsWith("vivo")) return "vivo";
        if (t.startsWith("asus")) return "asus";
        if (t.startsWith("huawei")) return "huawei";
        if (t.startsWith("honor")) return "honor";
        if (t.startsWith("zte") || t.startsWith("nubia")) return "zte";
        if (t.startsWith("sony")) return "sony";
        if (t.startsWith("nothing")) return "nothing";
        if (t.startsWith("nokia")) return "nokia";
        if (t.startsWith("cat")) return "cat";
        if (t.startsWith("tecno")) return "tecno";
        if (t.startsWith("infinix")) return "infinix";
        if (t.startsWith("itel")) return "itel";
        return t.split(" ")[0] || t;
    }

    // So sánh độ tương đồng
    similarity(a, b) {
        return stringSimilarity.compareTwoStrings(a, b);
    }

    extractBrand(modelName) {
        const tokens = modelName.split(" ");
        if (!tokens.length) return "";
        return this.normalizeBrand(tokens[0]);
    }

    cleanModel(m) {
        m = m.toLowerCase();
        const brand = this.extractBrand(m);
        if (m.startsWith(brand)) {
          m = m.slice(brand.length).trim();
        }

        m = m.replace(/\(.*?\)/g, ""); // remove parentheses
        m = m.replace(/\+/g, ""); // remove "+"
        m = m.replace(/\s+/g, " ").trim(); // clean extra spaces
        return m;
    }

    compareName(phone1, phone2) {
        const brand1 = this.extractBrand(phone1);
        const brand2 = this.extractBrand(phone2);

        if (brand1 !== brand2) {
            return false;
        }

        const model1 = this.cleanModel(phone1);
        const model2 = this.cleanModel(phone2);

        const similarityScore = this.similarity(model1, model2);
        return similarityScore;
    }

    findMostSimilar(deviceName, list) {
        let bestMatch = null;
        let highestScore = -1;

        list.forEach(item => {
            let name = deviceName.toLowerCase().trim();
            const gsmName = item.name.toLowerCase().trim();
            const score = this.compareName(name, gsmName);

            if (score > highestScore && score >= 0.7) {
                highestScore = score;
                bestMatch = { ...item, similarity: score };
            }
        });
        return bestMatch;
    }
}

function searchPhones(searchQuery, maxResults = 20) {
    try {
        const gsmData = gsmSource.result;

        // Kiểm tra cấu trúc dữ liệu
        if (!Array.isArray(gsmData) || gsmData.length < 2) {
            console.error("Dữ liệu không đúng định dạng: gsm_source.json phải chứa mảng [makers, devices]");
            return [];
        }

        const makers = gsmData[0];  // Danh sách nhà sản xuất
        const devices = gsmData[1]; // Danh sách thiết bị

        // Hằng số chỉ số các trường
        const MAKER_ID = 0;
        const PHONE_ID = 1;
        const PHONE_NAME = 2;
        const SEARCH_STR = 3;
        const THUMB = 4;
        const NAME_OVERRIDE = 5;

        // Chuẩn hóa từ khóa tìm kiếm
        const query = searchQuery.toLowerCase().trim();

        if (query.length === 0) {
            return [];
        }

        // Tách query thành các từ
        const queryWords = query.split(/\s+/g);
        const regexPatterns = [];
        const strictRegexPatterns = [];

        // Tạo các mẫu regex để tìm kiếm
        for (let word of queryWords) {
            const escapedWord = word.replace(/[/\-\\^$*+?.()|[\]{}]/g, '\\$&');
            const startsWithWord = escapedWord.match(/^\w/);
            const endsWithWord = escapedWord.match(/\w$/);

            regexPatterns.push(new RegExp((startsWithWord ? '\\b' : '') + escapedWord));
            strictRegexPatterns.push(new RegExp((startsWithWord ? '\\b' : '') + escapedWord + (endsWithWord ? '\\b' : '')));
        }

        // Hàm kiểm tra xem tất cả các mẫu regex có khớp với chuỗi không
        function matchesAllPatterns(str, patterns) {
            for (let pattern of patterns) {
                if (!str.match(pattern)) {
                    return false;
                }
            }
            return true;
        }

        // Hàm tạo tên đầy đủ của điện thoại
        function makePhoneName(device, useOriginalName = false) {
            const brand = makers[device[MAKER_ID]];
            const name = (device[NAME_OVERRIDE] !== undefined && !useOriginalName)
                ? device[NAME_OVERRIDE] || device[PHONE_NAME]
                : device[PHONE_NAME];
            return `${brand} ${name}`;
        }

        // Tạo chuỗi tìm kiếm
        function makeSearchString(device) {
            const brand = makers[device[MAKER_ID]];
            const searchStr = `${brand} ${device[SEARCH_STR]}`;
            return searchStr.toLowerCase();
        }

        // Tìm kết quả chính xác
        const results = [];

        // Kiểm tra nếu có kết quả chính xác
        const exactMatchIndex = devices.findIndex(device => {
            const fullName = makePhoneName(device).toLowerCase();
            return fullName === query;
        });

        if (exactMatchIndex !== -1) {
            const exactMatch = devices[exactMatchIndex];
            results.push({
                id: exactMatch[PHONE_ID],
                name: makePhoneName(exactMatch),
                brand: makers[exactMatch[MAKER_ID]],
                thumb: exactMatch[THUMB],
                exact: true
            });
        }

        // Tìm các kết quả khớp một phần
        for (let device of devices) {
            // Bỏ qua nếu đã tìm thấy chính xác
            if (exactMatchIndex !== -1 && device === devices[exactMatchIndex]) {
                continue;
            }

            const phoneName = makePhoneName(device).toLowerCase();
            const searchString = makeSearchString(device);

            // Kiểm tra nếu tên thiết bị khớp với tất cả các từ trong query
            if (matchesAllPatterns(phoneName, regexPatterns) || 
                (searchString && matchesAllPatterns(searchString, strictRegexPatterns))) {

                results.push({
                    id: device[PHONE_ID],
                    name: makePhoneName(device),
                    brand: makers[device[MAKER_ID]],
                    thumb: device[THUMB]
                });
            }

            // Dừng nếu đã đủ số lượng kết quả
            if (results.length >= maxResults) {
                break;
            }
        }

        return results;

    } catch (error) {
        console.error(`Lỗi khi tìm kiếm thiết bị: ${error.message}`);
        return [];
    }
}
let phoneMapped = [];
let phoneNotFound = [];
let comparer = new PhoneCompare();

for (const phoneName of Object.keys(listPhones)) {
  let foundedPhone = searchPhones(phoneName, 3);
    if(foundedPhone.length > 0) {
        let bestMatch = comparer.findMostSimilar(phoneName, foundedPhone);
        if(bestMatch) {
            phoneMapped.push({
                name: phoneName,
                ...listPhones[phoneName],
                "gsm": bestMatch
            });
        } else {
            phoneNotFound.push(phoneName);
        }
    } else {
      phoneNotFound.push(phoneName);
    }
}

let listNotfound2 = [];

for(const phone of phoneNotFound) {
    let cleanedName = phone.replace(/\b4G\b/gi, '').replace(/\b5G\b/gi, '').replace(" Plus", "+");
  const foundedPhone = searchPhones(cleanedName, 3);
  if(foundedPhone.length > 0) {
        let bestMatch = comparer.findMostSimilar(cleanedName, foundedPhone);
        if(bestMatch) {
            phoneMapped.push({
                name: phone,
                ...listPhones[phone],
                "gsm": bestMatch
            });
        } else {
            listNotfound2.push(phone);
        }
  } else {
    listNotfound2.push(phone)
  }
}

console.log(gsmSource);
return {phoneMapped, phoneNotFound, listNotfound2};

